import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <nav class="navbar bg-light">
      <div class="container">
        <div className="d-flex align-items-center">
          <Link class="navbar-brand" to="#">
            <img
              src="/logoHust.png"
              alt=""
              width="226"
              height="100"
              class="d-inline-block align-text-top"
            />
          </Link>
          <p className="text-start mb-0 fw-bolder fs-1">
            ĐẠI HỌC BÁCH KHOA HÀ NỘI <br /> TRƯỜNG CÔNG NGHỆ THÔNG TIN VÀ TRUYỀN
            THÔNG
          </p>
        </div>
      </div>
    </nav>
  );
}

export default Header;
